function values = get_average_per_n_minutes(arrival_times, delay_times, timeframe)
    if nargin < 3
        timeframe = 15;
    end
    
    per_day = mod(arrival_times, 1440);
    
    values = zeros(1,floor(1440/timeframe));
    count = 1;
    for i=0:timeframe:1440-timeframe
        valid = ((per_day > i)&(per_day < i+timeframe));
        valid_delays = delay_times(valid);
        values(count) = mean(valid_delays);
        count = count + 1;
    end
    
end
